import axios from "axios";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

const EmpList = () => {
  const [empList, setEmpList] = useState("");

  useEffect(() => {
    console.log("useEffect");
    axios.get("http://localhost:8081/emp/get-all-emps").then((resp) => {
      console.log(resp.data);
      setEmpList(resp.data);
    });
  }, []);

  return (
    <>
      <h1>Employee List</h1>
      <table>
        <thead>
          <th>Name</th> <th>Salary</th> <th>Email</th>
        </thead>
        <tbody>
          {empList &&
            empList.map((emp) => (
              <tr key={emp.id}>
                {/* <td >{emp.employeeId} </td> */}
                <td>{emp.firstName} </td>
                <td>{emp.salary} </td>
                <td>{emp.email} </td>
                <td><button on><Link to={"/updateEmp"}>Update</Link></button></td>
                <td><button><Link to={"/deleteEmp"}>Delete</Link></button></td>
              </tr>
            ))}
        </tbody>
      </table>
    </>
  );
};

export default EmpList;

